USE uDW
GO

DECLARE @DATA TABLE (BF_SSN VARCHAR(10), DOCUMENT_NAME1 VARCHAR(100), DOCUMENT_NAME2 VARCHAR(100), DOCUMENT_NAME3 VARCHAR(100), DOCUMENT_NAME4 VARCHAR(100))








SELECT DISTINCT
	AY10.BF_SSN,
	LD_ATY_RSP AS DATE_CLOSED,
	LF_PRF_BY AS UT#

FROM
	uDW..AY10_BR_LON_ATY AY10
WHERE
		PF_REQ_ACT = 'CRDSP'
		AND PF_RSP_ACT = 'COMPL'
		AND LD_ATY_RSP BETWEEN '07/01/2020' AND '07/31/2020'
	

